// App.js
import React from "react";
import WebcamCapture from "./WebcamCapture";
import UploadVideo from "./UploadVideo";

function App() {
  return (
    <div style={{ padding: "20px" }}>
      <h1>Video Analysis App</h1>
      <hr />
      <WebcamCapture />
      <hr />
      <UploadVideo />
    </div>
  );
}

export default App;
